      SELECT DISTINCT + + 29 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT - col2 <> + + col2 * - + col0 + col1 * - col1 * - CAST ( NULL AS INTEGER );
  - name: tab1

outputs:
  - name: q6266.out
    data: |
